      <Grid container spacing={3}> 

      {/* <Slider  volume={volume} onChange={handleVolumeChange} 
                    defaultValue={.5} step={.1} min={0} max={1} /> */}

      {songList.map(flash => {
                  return (
                  <Grid item xs={3} >

                    <Flashcard flashcard = {flash} key = {flash.id} volume={volume}> </Flashcard>
                  </Grid>
                  )
        })}

      </Grid>

    </div>
    </div>


    )
}
